  it('should compute big number', function () {
    let n = BigNumber(2)
    n = n.pow(1200)
    assert.equal(n.toString(), '')
  })

  it('should mul_poly', function () {
    const pk = loader.extract_der_priv_key(privKey)
    const [rc_0, rc_1, symmetric_stream] = loader.extract_der_ciphertext(cipherData)
    assert.deepEqual(pk.H_0.toArray(), H0)
    assert.deepEqual(rc_0.toArray(), C0)
    const result = mul_poly(pk.H_0, rc_0)
    assert.deepEqual(result.toArray(), kMulPoly)
  })

  it('should compute mul_poly 2', function () {
    const result = mul_poly(Float64Array.from(H0), Float64Array.from(C0))
    assert.deepEqual(result.toArray(), kMulPoly)
  })

