    const x = new Float64Array(H0)
    const expected = [60, 98, 480, 500, 598, 752, 1038, 1204, 1450, 1492, 1928, 2022, 2090, 2156, 2202, 2284, 2642, 2666, 2730, 3152, 3208, 3238, 3416, 3560, 4020, 4790, 4798, 4830, 4946, 5338, 5544, 6034, 6164, 6170, 6356, 6436, 6478, 6648, 6670, 7272, 7310, 7340, 8672, 9020, 9486]
